import Button from "@material-ui/core/Button";
import "./upvote.scss";

const STYLES = ["btn-primary-solid", "btn-secondary-icon"];

const upvote = ({ children, type, buttonStyle }) => {
  const checkButtonStyle = STYLES.includes(buttonStyle)
    ? buttonStyle
    : STYLES[0];
  return (
    <Button
      className={`btn ${checkButtonStyle}`}
      disableRipple="true"
      type={type}
    >
      {children}
    </Button>
  );
};

export default upvote;
